/* eslint-disable react/prop-types */
/* eslint-disable no-unused-vars */
import { Col, Row } from 'antd';
import React, { useState } from 'react';
import { Button } from '../../components/buttons/buttons';
import { Main } from '../styled';
import { ViewModals } from '../../components/modals/View-modals';

const AdsModalEdit = ({ modalType, visible }) => {
    const handleCancel = () => {
        
        setState({
            visible: false,
            colorModal: false,
        });
    };

    return (
        <Main>
            <Row gutter={15}>
                <Col md={12}>
                    <ViewModals type={modalType} title="Edit" visible={visible} onCancel={handleCancel}>
                        <p>Some contents...</p>
                        <p>Some contents...</p>
                        <p>Some contents...</p>
                    </ViewModals>
                </Col>
            </Row>
        </Main>
    );
};

export default AdsModalEdit;
